  [],\n\t\"revision_timestamp\": \"2016-07-27T23:02:29.228014\",\n\t\"name\": \"walrus-harvest-health-welfare-study-wales-alaska-progress-report-1981\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Charles Adsit was the FIVS representative
  stationed in Wales, Alaska to collect walrus harvest information during a period
  extending from May 11 to June 22, 1981. There were 128 walrus harvested in Wales.
  Tooth samples and tusk measurements totaled 101. Fourteen blubber and skin measurements
  were acquired from the one hundred one sampled animals. Harvesting of walrus took
  place on 9 days with 60 animals (47%) harvested during the last hunting day. Seven
  boat captains took part in the hunt. No crew sizes or boat hours were calculated.
  Sex ratio of harvested walrus was 72% adult males, 28% adult females and calf walrus
  did not occur in the harvest. Weather played an important role in the Wales walrus
  harvest.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
